import React from "react";
import { SiCashapp } from "react-icons/si";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";
import { FaRegHandPointRight, FaDollarSign } from "react-icons/fa";
import { MdNotificationImportant } from "react-icons/md";
import { RiVipCrownFill } from "react-icons/ri";
import { Button } from "react-bootstrap";
import { BsPinFill } from "react-icons/bs";
import { IoWallet } from "react-icons/io5";

const Mypage = () => {
  let navigate = useNavigate();

  // styled component
  let TopTitle = styled("p")`
    font-size: 48px;
  `;

  let Line = styled("div")`
    width: 80%;
    height: 5px;
    background-color: #2d4059;
    margin: 0 auto;
  `;
  // end styled component
  return (
    <div>
      <div className="cotainer-lg">
        <div
          className="row d-flex justify-content-center"
          style={{ width: "100%", paddingTop: "50px" }}
        >
          <div
            className="col-lg-1"
            onClick={() => {
              navigate("/");
            }}
            style={{ marginBottom: "20px", cursor: "pointer" }}
          >
            <SiCashapp
              style={{ color: "#EA5455", fontSize: "70px", margin: "0 20px" }}
            />
          </div>
          <div className="col-lg-9">
            <TopTitle>Check your point !!</TopTitle>
          </div>
        </div>
      </div>
      <Line></Line>
      <div className="container-lg " style={{ marginTop: "50px" }}>
        <div className="row" style={{ border: "2px solid #EA5455" }}>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <MdNotificationImportant style={{ fontSize: "20px" }} />
            <span style={{ margin: "0 10px" }}>회원등급표</span>{" "}
            <FaRegHandPointRight />
          </div>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <RiVipCrownFill color="#548CFF" />
            <span style={{ margin: "0 10px" }}>다이아</span>
            <span>0000점</span>
          </div>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <RiVipCrownFill color="#00BDAA" />
            <span style={{ margin: "0 10px" }}>플래티넘</span>
            <span>0000점</span>
          </div>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <RiVipCrownFill color="#FFE300" />
            <span style={{ margin: "0 10px" }}>골드</span>
            <span>0000점</span>
          </div>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <RiVipCrownFill color="#C8C2BC" />
            <span style={{ margin: "0 10px" }}>실버</span>
            <span>0000점</span>
          </div>
          <div
            className="col-2"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <RiVipCrownFill color="#E26A2C" />
            <span style={{ margin: "0 10px" }}>브론즈</span>
            <span>0000점</span>
          </div>
        </div>
      </div>

      {/* start value input */}
      <div
        className="container-lg d-flex justify-content-center"
        style={{ marginTop: "100px" }}
      >
        <div
          style={{
            width: "800px",
            height: "500px",
            backgroundColor: "#FFD460",
            display: "flex",
            flexFlow: "column wrap",
            justifyContent: "space-around",
            alignItems: "center",
            borderRadius: "7px",
          }}
        >
          <div style={{ fontSize: "24px", display: "flex" }}>
            <IoWallet size={"32px"} style={{ marginRight: "20px" }} />
            <span>(로그인 유저 닉네임)의 포인트는 ... ?</span>
          </div>
          <div
            style={{
              width: "500px",
              display: "flex",
              justifyContent: "center",
            }}
          >
            <FaDollarSign style={{ fontSize: "32px", color: "#EA5455" }} />
            <div
              style={{
                color: "black",
                width: "400px",
                fontSize: "24px",
                borderBottom: "2px solid #EA5455",
              }}
            >
              {/* {item.suggestion ? item.suggestion + " 원" : "없음"} */}
              평균가
            </div>
            <span style={{ fontSize: "32px" }}>원</span>
          </div>
          <div style={{ fontSize: "24px" }}>
            (로그인 유저 닉네임)의 평가금액은 ... ?
          </div>
          <div>
            <div
              style={{
                width: "500px",
                display: "flex",
                justifyContent: "center",
              }}
            >
              <BsPinFill style={{ fontSize: "32px", color: "#EA5455" }} />
              <div style={{ borderBottom: "2px solid #EA5455" }}>
                <input
                  style={{
                    color: "black",
                    width: "400px",
                    fontSize: "24px",
                    borderStyle: "none",
                    backgroundColor: "transparent",
                    textAlign: "center",
                  }}
                />
              </div>
              {/* {item.suggestion ? item.suggestion + " 원" : "없음"} */}
              <span style={{ fontSize: "32px" }}>원</span>
            </div>
            <Button
              style={{
                marginTop: "30px",
                backgroundColor: "#EA5455",
                borderStyle: "none",
              }}
            >
              평가입력
            </Button>
          </div>
        </div>
      </div>
      {/* end value input */}
    </div>
  );
};

export default Mypage;
